import React from "react";
import '../assets/css/Section2.css'
import Img2103 from '../assets/img/Grupo_2103.png'

function Section2() {
  return (
    <div className="Section2 row">
        <div className="col-md-12">
            <img src={Img2103} alt=""/>
        </div>
    </div>
  );
}

export default Section2;
